import React from "react";
import { Link, useNavigate } from "react-router-dom";




function Login (){

    const navigate = useNavigate();
    const handleMySubmissionsClick = () => {
      // Navigate to the new page when the button is clicked
      navigate("/FrameOne");
    };

    return(
        <div className="loginContainer bg-white-A700 shadow-lg w-[30%] m-auto h-[400px] text-center mt-[10%]">
        <form >
        <div className="pt-[5%]">
            <h1>UMaT TSAP</h1>
            <div className="inputField">
            <div className="m-[5%]"><input type="text" placeholder="Username"/> </div>  
            <div className="m-[5%]"><input type="password" placeholder="Password"/>  </div>
            </div>      
            <button >Login</button>
            <button type="submit" onClick={handleMySubmissionsClick} class="bg-teal-700 hover:bg-blue-700 text-white font-bold py-2 px-20 rounded-full">
  Login
</button>
            </div>
             </form>
        </div>
    )
}


export default Login;
